import React from "react";
import { NavLink } from 'react-router-dom';


const Sb = () => {
    return (
        <container>
            <div className="sign">
                <NavLink to="/" className="a">Sign Up</NavLink>
                <NavLink to="./department" className="a">Login </NavLink>
            </div>


        </container>


    );
}

export default Sb;
